if(isset($_GET['export_repair_funds']) || isset($_GET['export_repair_funds']) ) {
    $arg = array(
        'post_type' => $_GET['post_type'],
        'post_status' => 'publish',
        'posts_per_page' => -1,
    );

    global $post;
    $arr_post = get_posts($arg);
    if ($arr_post) {

        header('Content-type: text/csv');
        header('Content-Disposition: attachment; filename="Home Repair.csv"');
        header('Pragma: no-cache');
        header('Expires: 0');

        $file = fopen('php://output', 'w');

        fputcsv($file, array('Post ID', 'Program Name', 'URL','Eligible Property Type', 'Type of Assistance', 'Urgent','Lead Abatement?', 'Senior','ADA', 'Organization Name', 'City','Website','Phone No', 'Program Zipcode', 'Zipcode' ));

        foreach ($arr_post as $post) {
            setup_postdata($post);

			$home_repair_interested_help = get_field('home_repair_interested_help',get_the_ID());

			$home_repair_needs = get_field('home_repair_needs', get_the_ID());

			$home_repair_includes = get_field('home_repair_includes', get_the_ID());

			$senior = '';
			$lead_abatement = '';
			$ada = '';
			foreach ($home_repair_includes as $key => $value) {
				if( $value == 1 ) {
					$lead_abatement = 1;
				}

				if( $value == 2 ) {
					$senior = 1;
				}

				if( $value == 3 ) {
					$ada = 1;
				}
			}

			$home_repair_organization_name = get_field('home_repair_organization_name',get_the_ID());

			$home_repair_city = get_field('home_repair_city', get_the_ID());

			$home_repair_website_link = get_field('home_repair_website_link', get_the_ID());

			$home_repair_phone_no = get_field('home_repair_phone_no', get_the_ID());

			$home_repair_zipcode = get_field('home_repair_zipcode', get_the_ID());

			$home_repair_zipcode_list = get_field('home_repair_zipcode_list', get_the_ID());

			$home_repair_latitude = get_field('home_repair_latitude', get_the_ID());

			$home_repair_longitude = get_field('home_repair_longitude', get_the_ID());

            fputcsv($file, array(get_the_ID(),  get_the_title(), $post->guid, get_the_content(), $home_repair_interested_help, $home_repair_needs, $lead_abatement,$senior,$ada, $home_repair_organization_name, $home_repair_city, $home_repair_website_link, $home_repair_phone_no, $home_repair_zipcode, $home_repair_zipcode_list  ) );
        }

        exit();
    }
}


